/* eslint-disable jsx-a11y/anchor-is-valid */
import React from "react";

const ReadMoreItem01 = ({ onClick }) => {
  return (
    <li className="item more">
      <a onClick={onClick} className="moreLink">
        <div className="inner">
          <span>더보기</span>
        </div>
      </a>
    </li>
  );
};

export default ReadMoreItem01;
